(function(){
  'use strict';

  angular
    .module('app')
    .directive('menuAtivo', menuAtivoDirective);

  function menuAtivoDirective($state,$rootScope) {
    return {
      restrict: 'A',
      scope: {
        menuAtivo: '@',
        menuAtivoClass: '@'
      },
      transclude: false,
      link: menuAtivoLink
    }

    function menuAtivoLink(scope, element, attrs){
      function verificaMenu(){
        var state = '/'+$state.current.url.split('/')[1];
        if($state.get(scope.menuAtivo).url == state){
          element.addClass(scope.menuAtivoClass);
        }else{
          element.removeClass(scope.menuAtivoClass);
        }
      }
      verificaMenu();
      $rootScope.$on('$stateChangeSuccess',verificaMenu);      
    }
  }
})();

(function(){
	'use strict';

	angular
		.module('app')
		.directive("onLastItem", onLastItem);

	function onLastItem($timeout){
        let directive =  {
            restrict: "A",
            link: function (scope, element, attrs) {
                if (scope.$last) {
                    $timeout(function(){
                        scope.$eval(attrs.onLastItem);
                    },10);
                }
            }
        };
        return directive;
    };
})();
(function () {
    'use strict';
    angular
        .module('app')
        .component('onlineVideo', {
            bindings: {
                type: '=',
                urlId: '='
            },
            controller: onlineVideoController,
            controllerAs: 'vm',
            template: '<ng-bind-html ng-bind-html="vm.iframe"></ng-bind-html>'
        });
    onlineVideoController.$inject = ['$sce','$scope'];
    
    /* @ngInject */
    function onlineVideoController($sce, $scope) {
        var vm = this;
        var erro = "<h1>Falha ao carregar o v√≠deo</h1>";
        vm.iframe;
        function loadEmbed() {
            var type = vm.type == null ? 'vimeo' : vm.type;
            var video = getIframe(type, vm.urlId);
            vm.iframe = video == null ? erro : $sce.trustAsHtml(video);
        }
        $scope.$watch('vm.urlId', function(){
            loadEmbed();
        });
        vm.$onInit = function(){
           loadEmbed();
        };
        function getIframe(type, id) {
            var iframe;
            switch (type) {
                case 'vimeo':
                    iframe = "<iframe src='https://player.vimeo.com/video/" + id + "' width='640' height='360' frameborder='0' webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe>";
                    break;
                case 'youtube':
                    iframe = "<iframe width='560' height='315' src='https://www.youtube.com/embed/" + id + "' frameborder='0' allowfullscreen></iframe>";
                    break;
                case 'facebook':
                    iframe = '<iframe src="https://www.facebook.com/plugins/video.php?href=https%3A%2F%2Fwww.facebook.com%2Ffacebook%2Fvideos%2F' + id + '%2F&width=500&show_text=false&height=280&appId" width="500" height="280" style="border:none;overflow:hidden" scrolling="no" frameborder="0" allowTransparency="true"></iframe>';
                    break;
            }
            return iframe;
        }
    }
})();

(function(){
  'use strict';

  angular
    .module('app')
    .directive('onPageIsScrolled', onPageIsScrolled);

  function onPageIsScrolled($document, $timeout){
    return {
      link: onPageIsScrolled,
      scope: {
        onPageIsScrolled: '&',
        onPageIsNotScrolled: '&'
      }
    }

    function onPageIsScrolled(scope, element, attrs){
      let whenScroll = scope.onPageIsScrolled;
      let whenInTop = scope.onPageIsNotScrolled || false;
      let scrolled = false;

      $timeout(function(){onPageScrolled()});
      $document[0].addEventListener('scroll', function(){onPageScrolled()})

      function onPageScrolled(){
        if(pageYOffset && !scrolled){
          scope.$apply(whenScroll);
          scrolled = true;
        } else if(!pageYOffset) {
          if(whenInTop){
            scope.$apply(whenInTop);
          }
          scrolled = false;
        }
      }
    }

  }

})();

(function(){
    angular
        .module('app')
        .factory('disqus', disqus)
    
        function disqus(){
            var service = {
                create: create
            }
            return service;
            
            function create(){
                (function() { // DON'T EDIT BELOW THIS LINE
                var d = document, s = d.createElement('script');
                s.src = '//blogo2.disqus.com/embed.js';
                s.setAttribute('data-timestamp', +new Date());
                (d.head || d.body).appendChild(s);
                })();
            }
        }
})();
